// JS cote client
window.addEventListener('load', launch);

function launch(){
	fetch('http://' + location.host + '/carte').then(function(res) {
		var coucou = res.json();
		console.log(coucou);
		return coucou;

	}).then(function(data) {
		//console.log(data);
		let czml = formatedata(data);
		initiateCesiumCzml(czml);

	}).catch(function(error) {
		console.log(error);
		alert('l initialisation n a pas fonctionn√©');
	});
}

function formatedata(data){
	var czml = [{    "id" : "document",
        "name" : "CZML Path",
        "version" : "1.0",
        "clock": {
            "interval": "2012-08-04T10:00:00Z/2012-08-04T15:00:00Z",
            "currentTime": "2012-08-04T10:00:00Z",
            "multiplier": 1}
	}];

	var path = {"id" : "path",
        "name" : "path with GPS flight data",
        "description" : "<p>Hang gliding flight log data from Daniel H. Friedman.<br>Icon created by Larisa Skosyrska from the Noun Project</p>",
        "availability" : "2012-08-04T10:00:00Z/2012-08-04T10:01:20Z",
        "path" : {
            "material" : {
                "polylineOutline" : {
                    "color" : {
                        "rgba" : [255, 0, 255, 255]
                    },
                    "outlineColor" : {
                        "rgba" : [0, 255, 255, 255]
                    },
                    "outlineWidth" : 5
                }
            },
            "width" : 8,
            "leadTime" : 10,
            "trailTime" : 1000,
            "resolution" : 5
        },
        "billboard" : {
			"image": "data:image/png;base64,",
            "scale": 0.05,
            "eyeOffset": {
                "cartesian": [0.0, 0.0, -10.0]
            }
        },
        "position" : {
            "epoch": "2012-08-04T10:00:00Z",
            "cartographicDegrees": []
        }
        };
	let intervalle = 0;
	data.forEach(function(item, index){
		path.position.cartographicDegrees.push(intervalle, item.long, item.lat, item.alt +250);
		intervalle = intervalle + 10;
	});
	czml.push(path);

	return czml;
}

function initiateCesiumCzml(data){

	console.info('BOUUUUUUUUUM', data);

    var viewer = new Cesium.Viewer('cesiumContainer', {
        terrainProvider : Cesium.createWorldTerrain(),
        baseLayerPicker : false,
        shouldAnimate : true
    });

    viewer.dataSources.add(Cesium.CzmlDataSource.load(data)).then(function(ds) {
        viewer.trackedEntity = ds.entities.getById('path');
    });


}

function initiateCesiumClassic(data) {
	var viewer = new Cesium.Viewer('cesiumContainer');
	
	var trace = viewer.entities.add({
		name: 'My Super path',
		polyline: {
			positions: data.map(function(coords){
				return Cesium.Cartesian3.fromDegrees(coords.long, coords.lat, coords.alt);
			}),
			id: {
				poulet:5
			}
		}
	});
	viewer.zoomTo(trace);


}